    FullSearchResultTopdownTemplate.prototype.truncateText = function (val) {
        var textMsg = val;
        textMsg = textMsg.split(' ');
        var truncatedText = '';
        textMsg.every(function (text) {
            if ((truncatedText + (truncatedText ? ' ' : '') + text).length > 20) {
                if (!truncatedText.length) {
                    truncatedText = text.slice(0, 19) + ' ...';
                }
                else {
                    truncatedText = truncatedText + ' ...';
                }
                return false;
            }
            else {
                if (truncatedText && truncatedText.length > 20) {
                    truncatedText = truncatedText + ' ...';
                    return false;
                }
                else {
                    if ((truncatedText + (truncatedText ? ' ' : '') + text).length > 20) {
                        truncatedText = truncatedText + ' ...';
                        return false;
                    }
                    else {
                        truncatedText = truncatedText + (truncatedText ? ' ' : '') + text;
                    }
                }
            }
            return true;
        });
        return truncatedText;
    };
